package main

import (
    "fmt"
    "strconv"
    "strings"
)

func CompareOne(a, b interface{}) interface{} {
    var numA, numB float64
    var errA, errB error

    switch v := a.(type) {
    case int:
        numA = float64(v)
    case float64:
        numA = v
    case string:
        v = strings.ReplaceAll(v, ",", ".")
        numA, errA = strconv.ParseFloat(v, 64)
        if errA != nil {
            return nil
        }
    default:
        return nil
    }

    switch v := b.(type) {
    case int:
        numB = float64(v)
    case float64:
        numB = v
    case string:
        v = strings.ReplaceAll(v, ",", ".")
        numB, errB = strconv.ParseFloat(v, 64)
        if errB != nil {
            return nil
        }
    default:
        return nil
    }

    if numA == numB {
        return nil
    }

    if numA > numB {
        return a
    }
    return b
}

